import Sidebar from './Components/Sidebar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Sidebar />
      <Switch>
         <Route path="/inventory" exact component={Inventory} />
      </Switch>
    </Router>
  );
}

export default App;
